// Home page big input
function HomeSearch () {
    return (
        <form action="/" method="get">
        <input
            type="text"
            id="header-search"
            placeholder="Search books"
            className = "introInput"
        />
        <button 
            className = "introSearch"
            >Search
        </button>
    </form>
    )
};
export default HomeSearch;
